pragma solidity ^0.8.0;

import "./TokenSP.sol";
import "./ServiceProvider.sol";

// TODO: REMOVE AFTER DEBUGGING
import "hardhat/console.sol";

error ReputationFactory__DuplicateServiceProviderName();
error ReputationFactory__ServiceProviderDoesNotExist();

contract ReputationFactory {
    mapping(string => address) private registry;
    address private owner;

    constructor() {
        owner = msg.sender;
    }

    function createServiceProvider(string memory name) public {
        // Check if the service provider name has already been registered
        if (registry[name] != address(0)) {
            revert ReputationFactory__DuplicateServiceProviderName();
        }
        ServiceProvider serviceProvider = new ServiceProvider(address(this));
        registry[name] = address(serviceProvider);
    }

    // returns the address for the given name of the service provider
    function getServiceProviderAddress(
        string memory name
    ) public view returns (address) {
        return registry[name];
    }

    // returns the service provider contract given the name of the service provider
    function getServiceProvider(
        string memory name
    ) public view returns (ServiceProvider) {
        address spAddress = getServiceProviderAddress(name);
        if (spAddress == address(0)) {
            revert ReputationFactory__ServiceProviderDoesNotExist();
        }
        return ServiceProvider(spAddress);
    }

    // creates a user token for the given name of the service provider
    function createServiceProviderUserToken(string memory name) public {
        ServiceProvider serviceProvider = getServiceProvider(name);
        serviceProvider.createUserToken();
    }

    // creates a review for the given name of the service provider
    // requires valid tokenId and reviewText
    function createServiceProviderReview(
        string memory name,
        uint256 tokenId,
        string memory reviewText
    ) public {
        ServiceProvider serviceProvider = getServiceProvider(name);
        serviceProvider.sendReview(tokenId, reviewText);
    }

    // returns the reviews for the given name of the service provider
    function getServiceProviderReview(
        string memory name
    ) public view returns (string[] memory) {
        ServiceProvider serviceProvider = getServiceProvider(name);
        return serviceProvider.getReview();
    }

    // returns the tokenId for the given name of the service provider
    function getServiceProviderTokenId(
        string memory name
    ) public view returns (uint256) {
        ServiceProvider serviceProvider = getServiceProvider(name);
        return serviceProvider.getTokenId();
    }
}
","keccak256":"0xbb16f51673b932093713d9e9cb93022ee23b05b894aa86aefa9895ee4c9ec66c","license":"MIT"},"contracts/ServiceProvider.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./TokenSP.sol";

// TODO REMOVE AFTER DEBUGGING
import "hardhat/console.sol";

error ServiceProvider__InvalidUserToken();
error ServiceProvider__NotEnoughTokenSP();

contract ServiceProvider {
    string[] private reviews;
    address private owner;
    address private factory;
    TokenSP private tokenSP;
    // NOTE: AFTER CHANGING THIS OR THE TOKENSP VALUE, CHANGE THE UNIT TEST
    uint256 constant tokenSPConsumption = 10; // TODO CHANGE THE AMOUNT OF ERC20 THAT IS CONSUMED

    uint256 tokenId = 0;    // Creates unique TokenId here
    mapping(uint256 => bool) tokenReviewGiven; // Storing TokenId here

    string private publicKey;

    event Minted(address indexed minter, uint tokenId);

    constructor(address _factory) {
        owner = msg.sender;
        factory = _factory;
        tokenSP = new TokenSP(100); // TODO CHANGE 100 TO THE AMOUNT YOU'D LIKE
    }

    function createBlindToken() public returns (string memory) {}

    function createUserToken() public {
        try tokenSP.transfer(factory, tokenSPConsumption) returns (
            bool /* result */
        ) {
            tokenReviewGiven[tokenId] = true;

            emit Minted(msg.sender, tokenId);

            tokenId++;
        } catch (bytes memory /* reason */) {
            revert ServiceProvider__NotEnoughTokenSP();
        }
    }

    function sendReview(uint256 _tokenId, string memory reviewText) public {
        if (tokenReviewGiven[_tokenId] == false) {
            revert ServiceProvider__InvalidUserToken();
        }
        tokenReviewGiven[_tokenId] = false;
        // TODO: hash the text and send to off chain
        reviews.push(reviewText);
    }

    function getReview() public view returns (string[] memory) {
        return reviews;
    }

    function getTokenId() public view returns (uint256) {
        return tokenId;
    }
}
